                    Document title: Guidance note Isolation of plant 2010
                    Document summary: The guidance note from the Commission for Occupational Safety and Health in Western Australia focuses on the isolation of plant to prevent workplace injuries. It outlines the legislative framework, principles, and procedures for isolating plant, emphasizing strict adherence and risk management. The document details steps for isolating various energy sources, including electrical, fluid, steam, and pneumatic energy, and highlights the use of lockout and tagging systems. It also covers the responsibilities of employers and workers under the Occupational Safety and Health Act 1984 and provides references for further information and resources.
                    ----

                    Section name: 8. Energy sources                
                    Text content: Plant energy sources include:
• electricity (mains, solar and by generator);
• chemicals;
• fuels;
• heat;
• steam;
• pneumatic pressure (compressed air);
• fluids under pressure, such as water or hydraulic oil;
• energy storing devices, such as batteries, springs, flywheels, accumulators and capacitors;
• gravity; and
• radiation.



